import React from 'react'

function Shop() {

    let items = []

    function Goods({name,thumbnail,price}){
        return (
            <div>
                <h1>{name}</h1>
                <img src = {thumbnail} alt = "thumbnail of {name}" ></img>
                {price}
            </div>
        )
    }

    fetch('api/goods/')
        .then(response => response.json())
        .then(shop_json => {
            items = shop_json
            console.log(items) 
        })
    return (
        <div>
            {items.map(
                item => {<Goods name = {item.name} thumbnail = {item.thumbnail} price = {item.price} />}
            )
            }
        </div>
    )
}

export default Shop
